        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 36
    }
}));

export default function Exhistorypage() {
    const classes = useStyles();
    const [stateA, setStateA] = useState(false)
    const value = Navbar2.handlerValue
