        <ScrollView>
            <div className={value ? classes.scrollspace : classes.scrollspace36}>
                <div>
                    <div className={classes.frame}>
                        {}
                        <Datetoday />
                    </div>
                    <div>
                        <Exfloorcard />
                    </div>
                </div>
            </div>
        </ScrollView>

    )
}
